    "descriptions": [
      {
        "id": 109976,
        "HotelId": 1030097,
        "Description": "Swissotel Sydney enjoys a vibrant inner-city location, offering relaxed and luxurious surroundings in the vicinity of some of the best dining, shopping, entertainment and landmarks Sydney has to offer. The Sydney Harbour Bridge, the Sydney Opera House and the beautiful Botanic Gardens are all within easy reach of the hotel. In the tradition of all hotels from this chain, guests here will experience warm, reliable and efficient service. Amrita Spa and the fitness centre offer hotel guests and members access to the latest in cardio equipment, as well as use of an outdoor heated swimming pool, hot tub and steam and sauna rooms. Modern Australian cuisine is served at the restaurant, JPB. The hotel bar and lounge, Crossroads, serves an express lunch and afternoon high tea in plush surroundings. The guest's visit will be a truly unforgettable experience with a stay at the Swissotel Sydney.",
        "createdAt": null,
        "updatedAt": null
      }
    ]
