    "descriptions": [
      {
        "id": 547755,
        "HotelId": 1053891,
        "Description": "The Newport Mirage is a 4-star waterfront hotel located just 45 minutes from Sydney CBD. The hotel is situated on the tranquil shores of Pittwater located in the heart of beautiful Northern Beaches and a stone's throw from famous Palm Beach. It's unique location makes it a prime base to explore the beaches and is also neighboring to Sydney's iconic Newport Arms Hotel home to Australia's largest waterfront beer garden. Pittwater is renown for its beautiful surrounds so escape and explore this picturesque area we look forward to welcoming you. Please NoteNewport Mirage Hotel will now require all guests to provide photo ID on check in.",
        "createdAt": null,
        "updatedAt": null
      }
    ]
